import { addCountAction, addElemsAction } from "./basketReducer"

const defaultState = {
    priceSum:0
}



export const sumReducer = (state = defaultState, action) => {
    switch (action.type) {
        case 'SUM_PRICE':
            return {...state, priceSum: state.priceSum.forEach((item)=>{
                addCountAction += item.addCountAction

            })}
        default:
            return state
    } 
}

export const AddSumPriceAction = (payload) => ({type:'SUM_PRICE' , payload})
